import React, { Component } from "react"
import "./StarRating.css"


class StarRating extends Component {


    state = {

        rentService: undefined,
        reservedCar: undefined

    }


    componentDidMount() {


    }


    render() {

        var idZvezdice = "";

        if (this.props.rentService) {
            idZvezdice = this.props.rentService.id + "servis";
        }
        else if (this.props.reservedCar) {
            idZvezdice = this.props.reservedCar.id + "servis";
        }


        return (

            <fieldset class="rating">
                <input type="radio" id={idZvezdice + '5'} name="rating" value="5" /><label className="full" for={idZvezdice + '5'} title="Odlican! - 5 zvezdica"></label>
                <input type="radio" id={idZvezdice + '4'} name="rating" value="4" /><label className="full" for={idZvezdice + '4'} title="Vrlo dobar - 4 zvezdica"></label>
                <input type="radio" id={idZvezdice + '3'} name="rating" value="3" /><label className="full" for={idZvezdice + '3'} title="Ajde da kazem dobar - 3 zvezdice"></label>
                <input type="radio" id={idZvezdice + '2'} name="rating" value="2" /><label className="full" for={idZvezdice + '2'} title="Onakooooo - 2 zvezdice"></label>
                <input type="radio" id={idZvezdice + '1'} name="rating" value="1" /><label className="full" for={idZvezdice + '1'} title="Jako lose - 1 star"></label>
            </fieldset>

        );
    }

};

export default StarRating;
